import { FC } from "react";
import { useParams } from "react-router-dom";
import { ProductData } from "../types/types";

interface ProductProps {
  product: ProductData;
}

export const Product: FC<ProductData> = ({ product }) => {
  const { id } = useParams();

  return <h1>Product Page: {id}</h1>;
};
